commits.content:
body {
    font-family: Arial, sans-serif;
    margin: 0;
    display: flex;
    justify-content: center;
    align-items: center;
    height: 100vh;
    background-color: #f5f5f5;
}

.sidebar {
    background-color: #333;
    color: #fff;
    width: 250px;
    height: 100%;
    padding-top: 20px;
    float: left;
}

.sidebar h2 {
    text-align: center;
}

.sidebar ul {
    list-style-type: none;
    padding: 0;
}

.sidebar li {
    padding: 10px;
    position: relative;
}

.sidebar a {
    color: #fff;
    text-decoration: none;
}

.submenu {
    display: none;
    position: absolute;
    left: 100%;
    top: 0;
}

.sidebar li:hover .submenu {
    display: block;
    background-color: #333;
}
